import React, { useState, useEffect } from 'react';

// Dummy data with corrected unique IDs
const dummyUsers = [
    { id: 1, name: 'Bruker 1', role: 'Superbruker' },
    { id: 2, name: 'Bruker 2', role: 'Bruker' },
    { id: 3, name: 'Bruker 3', role: 'Superbruker' },
    { id: 4, name: 'Bruker 4', role: 'Bruker' },
    { id: 5, name: 'Bruker 5', role: 'Superbruker' },
    { id: 6, name: 'Bruker 6', role: 'Bruker' },
    { id: 7, name: 'Bruker 7', role: 'Superbruker' },
    { id: 8, name: 'Bruker 8', role: 'Bruker' },
    { id: 9, name: 'Bruker 9', role: 'Superbruker' },
    { id: 10, name: 'Bruker 10', role: 'Bruker' },
    // ... flere brukere
];

const UsersTable = () => {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        // Simulate fetching data
        setUsers(dummyUsers);
    }, []);

    const deleteUser = (userId) => {
        setUsers(users.filter(user => user.id !== userId));
    };

    // Let's imagine an editUser function could go here.
    // For simplicity, we'll focus on deleting users in this example.

    return (
        <div className="overflow-x-auto relative shadow-md sm:rounded-lg">
            <table className="w-full text-sm text-left text-gray-500 dark:text-gray-400">
                <thead className="text-xs text-gray-700 uppercase bg-gray-50 dark:bg-gray-700 dark:text-gray-400">
                <tr>
                    <th scope="col" className="py-3 px-6">
                        Brukere
                    </th>
                    <th scope="col" className="py-3 px-6">
                        Rolle
                    </th>
                    <th scope="col" className="py-3 px-6">
                        Oppgaver
                    </th>
                </tr>
                </thead>
                <tbody>
                {users.map((user) => (
                    <tr key={user.id} className="bg-white border-b dark:bg-gray-800 dark:border-gray-700 hover:bg-gray-50 dark:hover:bg-gray-600">
                        <td className="py-4 px-6">{user.name}</td>
                        <td className="py-4 px-6">{user.role}</td>
                        <td className="py-4 px-6">
                            <button className="font-medium text-blue-600 dark:text-blue-500 hover:underline mr-2">Endre</button>
                            <button className="font-medium text-red-600 dark:text-red-500 hover:underline" onClick={() => deleteUser(user.id)}>Slett</button>
                        </td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};

export default UsersTable;
